import './Intro.css';
import pfp from'../extra/pfp.jpeg'

function Intro() {
  return (
    <div className="Intro">
        <div id="header">
            <h1 id="name">Camille Gandotra</h1>
            <img id="pfp" src={pfp}></img>

        </div>
    </div>
  );
}

export default Intro;
